do módulo Pagar.me','Bom dia!\r\nUm cliente efetuou o pagamento de um boleto, na pagar.me está ok, o boleto caiu. Porem em nosso site consta como pendente ainda, acredito que esteja com problema na integração.','Foi  feito a atualização do módulo.','Resolvido','Baixa',NULL,'2024-04-19 17:15:41',NULL),(29,1,26,'412619','Instalação do módulo Google Merchant','Olá time!\r\nPoderiam instalar o modulo do Google Merchant igual ao da cia pneus','Instalado  o módulo.','Resolvido','Baixa',NULL,'2024-04-18 17:25:35',NULL),(30,1,27,'412855','Exibição da home page ao salvar promoção',' Ao tentar criar uma promoção, dentro de ações aparece a home da loja, mesmo apertando f5 não atualiza nem desloga do painel','Boa tarde equipe!\r\nForam realizadas alguns testes no ambiente de produção e não foi possível reproduzir o mau comportamento relatado pelo cliente na configuração/atualização na regra de promoção do carrinho de compras, como mostra a evidência abaixo.\r\n\r\n \r\n\r\nNos testes realizados, foram testados os seguintes cenários:\r\n\r\nCriação de uma nova regra de promoção.\r\n- Edição da regra de promoção\r\n- Limpeza de cache Redis e CDN\r\n\r\nContudo, sugiro que monitore essa loja para ver se o mesmo comportamento volta acontecer.','Resolvido','Baixa',NULL,'2024-04-18 17:51:29',NULL),(31,2,28,'412696','Atualização do módulo Pagar.me','Bom dia equipe, tudo bem?\r\n\r\nPor gentileza, poderia realizar a atualização no módulo do método de pagamento Pagar-me.\r\n\r\nConforme esta sendo aplicado na loja https://www.astrodistribuidora.com/ atraves do ticket 412340.','Módulo já  instalado','Resolvido','Baixa',NULL,'2024-04-03 17:59:07',NULL),(32,3,29,'412668','Instalar módulo Bloqueio de Compras','Boa tarde, por gentileza, poderia instalar o módulo \'Bloqueio de Compras\' na loja','Feito','Resolvido','Baixa',NULL,'2024-04-03 20:38:22',NULL),(33,2,30,'412695','Instalação da funcionalidade Pix PagSeguro','Boa tarde equipe, tudo bem?\r\nPoderiam instalar p PIX do PagSeguro na loja