o na loja Astro (412340).\r\n\r\nA dificuldade na loja é que os pedidos mesmo após o pagamento continuam com o status pendente.','Instalado o módulo mais atual','Resolvido','Baixa',NULL,'2024-04-10 19:57:59','2024-04-11 14:13:46'),(47,2,38,'414154','Instalação do módulo Pagar.me','Boa tarde equipe, tudo bem?\r\n\r\nPor gentileza, poderia instalar o método de pagamento Pagar-me na loja.','Instalado a última versão do módulo.','Resolvido','Baixa',NULL,'2024-04-11 14:18:51','2024-04-11 14:58:51'),(48,7,39,'414231','Instalação do módulo Itaú Shopline','Boa tarde!\r\n\r\nfavor instalar o módulo ITAÚ SHOPLINE, conforme loja em produção: https://www.eletronservice.com.br','O módulo instalado, foi removido da própria loja em produção.','Resolvido','Baixa',NULL,'2024-04-12 12:12:05','2024-04-12 16:58:46'),(49,7,39,'414233','Instalação do módulo Frenet','Boa tarde,\r\npor favor instalar o módulo da frenet na loja nova.\r\nFRENET = Base loja em produção Eletron Service - São Paulo','O módulo já se encontra instalado.','Resolvido','Baixa',NULL,'2024-04-12 17:38:48',NULL),(50,7,39,'414234','Instalação do módulo de Otimização de Loja','Boa tarde,\r\nPor favor instalar o módulo  Otimizar Loja com base na loja em produção Eletron Service - São Paulo','','Resolvido','Baixa',NULL,'2024-04-12 17:45:35','2024-04-12 21:05:49'),(51,9,40,'413038','Cadastro de nova conta, falha na validação da data de nascimento','Boa tarde, tudo bem?\r\n\r\nAo realizar um cadatro na loja pelo carrinho de compra o mesmo não é salvo e somente atualiza a página.\r\n\r\nObs: A validação da data de nascimento está falhando e, por conta disso, o form n é enviado pro back. Desabilitar o campo de data de nascimento resolve temporariamente, mas é necessário debugar e corrigir a validação do campo para reativa-lo.','O erro que estava acontecendo era por causa de uma regra de validação \'validate-dob\' que estava que brando o js. Como o esse mesmo campo já possui uma regra de validação(validade-date) que faz a mesma coisa, o jeito foi remover a regra validate-dob das regras do campos.','Resolvido','Baixa',NULL,'2024-04-12 20:41:42','2024-04-17 18:04:15'),(60,2,41,'414237','Atualização do método de pagamento Pagar.me','Bom dia equipe, tudo bem?\r\n\r\nPor gentileza, poderia realizar a atualização no módulo do método de pagamento Pagar-me.','Atualizado como a última versão do módulo.','Resolvido','Baixa',NULL,'2024-04-17 18:09:15',NULL),(61,3,42,'414313','Orçamento de instalação da modalidade Pix do Mercado Pago','Bom dia,\r\npor gentileza orçar o módulo do mercado pago para PIX','','Resolvido','Baixa',NULL,'2024-04-17 19:12:49','2024-04-18 21:59:36'),(62,4,43,'414194','Falha na exibição dos produtos relacionados há categoria.','{\"ops\":[{\"insert\":\"Bom dia Equipe! Descrição da Falha: Dentro do cadastro do produto, na aba \\\"Categorias\\\" não esta sendo exibido as categorias cadastradas. Passos Tomados até o Momento: Já conferi o cadastro de categorias, e esta correto.\\n\"}]}','{\"ops\":[{\"insert\":\"Boa tarde equipe! \\n\\nSegue o ajuste da apresentação das categorias, no detalhes do produto, no painel administrativo. Será necessário executar uma instrução SQL no banco de dados da loja em produção, onde será corrigido a configuração da categoria raiz. \\n\\nA instrução SQL se encontra abaixo: \\n\"},{\"attributes\":{\"bold\":true},\"insert\":\"UPDATE catalog_category_entity SET children_count=ABS(children_count) WHERE entity_id = 1277\"},{\"insert\":\"\\n\"}]}','Resolvido','Baixa',NULL,'2024-04-17 19:24:54','2024-04-20 16:44:50'),(65,4,48,'414599','Limpeza dos dados do módulo Anymarket','Bom dia, tudo bem?\r\nPor gentileza, podem me auxiliar na exclusão do produto dentro do módulo da AnyMarket? Este produto foi excluído dentro do painel da Any e agora está causando conflito, não sendo possível desativá-lo daqui. ','Foi necessário executar um comando no banco de dados, como relatado no ticket e solicitado na task: https://bis2bis-jira.atlassian.net/browse/INFRA-3473','Resolvido','Baixa',NULL,'2024-04-22 12:48:05','2024-04-22 14:32:59'),(66,4,16,'414723','Instalação do móudlo Exportação de dados Via shell','Bom dia, time\r\nPor gentileza, instar o modo de exportação via shell na loja. ','','Resolvido','Baixa',NULL,'2024-04-22 14:35:15','2024-04-22 18:35:13'),(67,4,49,'414672','Atualização do módulo Mercado Pago - CC','Bom dia, time\r\nPor gentileza, atualizar o módulo do  Mercado Pago na loja.\r\nPreciso que o módulo seja igual ao da https://www.editoraculturacrista.com.br/ para ser possível personalizar as parcelas. ','','Resolvido','Baixa',NULL,'2024-04-22 18:41:03','2024-04-22 20:05:40'),(68,3,34,'414243','Histórico de atualização de produtos','Bom dia Equipe!\r\n\r\nLink: https://loja.sonhart.com.br/index.php/admin/catalog_product/edit/id/41049/key/0f46d9b9d2ecc88b11b1da4ae0513bf5/\r\n\r\nDescrição da Falha: ao clicar em \"history of changes\", está carregando mas não acessa as opções.\r\n\r\nComportamento padrão: mostrar o histórico das alterações do produto\r\n\r\nPassos Tomados até o Momento: testes e validação do erro\r\n\r\nAnexos: https://www.awesomescreenshot.com/video/26664715?key=ed6fcf193b38d17d1194aedf18308c75\r\n\r\nAtenciosamente,','','Resolvido','Baixa',NULL,'2024-04-22 21:05:13','2024-04-29 16:59:14'),(69,12,50,'412149','Instalação do módulo Login Social','Copiar o módulo daqui: https://git2bis.com.br/bis2bis/bis2bis-stores/oticasequilibrium/-/commit/5a2201dc6a583a45b96bb7c6c590b1ebb57245de','Instalação do módulo via pasta.','Resolvido','Baixa',NULL,'2024-04-23 19:40:29',NULL),(70,1,51,'414762','Instalação do módulo Pagar.me','Boa tarde Equipe!\r\n\r\nDescrição da Falha: Os pedidos tem seus pagamentos recebidos no painel do Pagar.me, mas não estão atualizando no painel administrativo.\r\n\r\nSegue o número do pedido: # 100044193\r\nPagamento efetuado no dia 16/04/24, via boleto bancário.','','Resolvido','Baixa',NULL,'2024-04-24 11:33:42','2024-04-24 13:08:57'),(71,5,52,'414915','Instalação do módulo GA4','Bruno,\r\